import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router)

const router = new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      meta: {
        icon: 'home', title: 'Home'
      },
      component: () => import(/* webpackChunkName: "home" */ './pages/home/Home')
    },
    {
      path: '/cronograma',
      name: 'cronograma',
      meta: {
        icon: 'calendar-alt', title: 'Cronograma'
      },
      component: () => import(/* webpackChunkName: "cronograma" */ './pages/cronograma/Cronograma')

    },
    {
      path: '/profissionais',
      name: 'profissionais',
      meta: {
        icon: 'user-md', title: 'Profissinais'
      },
      component: () => import(/* webpackChunkName: "profissionais" */ './pages/profissionais/Profissionais')

    },
    {
      path: '/salas-cirurgicas',
      name: 'salas-cirurgicas',
      meta: {
        icon: 'clinic-medical', title: 'Salas Cirúrgicas'
      },
      component: () => import(/* webpackChunkName: "salas-cirurgicas" */ './pages/salas-cirurgicas/SalasCirurgicas')

    },
    {
      path: '/login',
      name: 'login',
      meta: {
        title: 'Login'
      },
      component: () => import(/* webpackChunkName: "login" */ './pages/login/Login')
    }
  ]
})

router.beforeEach((to, from, next) => {
  document.title = `${to.meta.title} - SCAC`
  if (!window.uid && to.name !== 'login') {
    next({ name: 'login' })
  } else {
    next()
  }

})
export default router
